import React from 'react'
import { SelectFile } from '../../atoms/selectFile/SelectFile'

export const PanelSelectFile = ({files,selected,action}) => {

  return (
    <ul>
        {
            files.map(file=>{
                return (
                    <li key={file}>
                        <SelectFile action={action(file)} fileName={file} selected={selected}/>
                    </li>
                )
            })
        }
    </ul>
  )
}
